import { Col, Container, Row } from "react-bootstrap";

function About() {
  return (
    <Container>
      <div className="about">
        <Row>
          <Col>
            <img src="../logo.png" alt="logo" />
          </Col>
          <Col>
          <div className="about-text">

          </div>
          </Col>
        </Row>
      </div>
    </Container>
  );
}
export default About;
